import React from "react";
import "./ArticleGenuine.css";

const ArticleGenuine = () => (
  <section className="articlegenuine-section">
    <div className="articlegenuine-img-wrap">
      <img
        src="./images/tip/tip1.png"
        alt="Tips to help you distinguish genuine billiard cues"
        className="articlegenuine-img"
      />
    </div>
    <div className="articlegenuine-content">
      <h2 className="articlegenuine-title">Tips to help you distinguish genuine billiard cues</h2>
      <button className="articlegenuine-btn">SEE MORE</button>
    </div>
  </section>
);

export default ArticleGenuine;
